DROP TABLE IF EXISTS tx_data;	CREATE TABLE tx_data(		Txn_Id VARCHAR(24),		Txn_Type VARCHAR(24),		Txn_Status VARCHAR(24), 		Sttlmnt_Dt DATETIME,		Disbursement_Dt DATETIME,		Auth_Amt FLOAT,		Settled_Amt FLOAT,		Refund_Txn_Id VARCHAR(24),		Payment_Type VARCHAR(24),		Card_Type VARCHAR(24),		CC_Number VARCHAR(24),		Billing_Postal_Code VARCHAR(24),		Billing_Country VARCHAR(24),		Shipping_Postal_Code VARCHAR(24),		Shipping_Country VARCHAR(24),		IP_Addr VARCHAR(24),		Processor_Response_Code FLOAT,		Settlement_Currency VARCHAR(24),		PRIMARY KEY ( Txn_Id )	)	;
